package br.com.painelcontrole.security;

import java.util.Collection;

import org.springframework.security.core.GrantedAuthority;
import org.springframework.security.core.userdetails.User;

public class UserICF extends User{

	public UserICF(String username, String password, boolean enabled,
			boolean accountNonExpired, boolean credentialsNonExpired,
			boolean accountNonLocked,
			Collection<? extends GrantedAuthority> authorities) {
		super(username, password, enabled, accountNonExpired, credentialsNonExpired,
				accountNonLocked, authorities);
		// TODO Auto-generated constructor stub
	}
	
	
	public String fun_cd;
	public String fun_nm;
	public String fun_nmguerra;
	public String fun_situacao;
	public String fun_email;
	public String data_base;
	
	public String getFun_cd() {
		return fun_cd;
	}

	public void setFun_cd(String fun_cd) {
		this.fun_cd = fun_cd;
	}

	public String getFun_nm() {
		return fun_nm;
	}

	public void setFun_nm(String fun_nm) {
		this.fun_nm = fun_nm;
	}

	public String getFun_nmguerra() {
		return fun_nmguerra;
	}

	public void setFun_nmguerra(String fun_nmguerra) {
		this.fun_nmguerra = fun_nmguerra;
	}

	public String getFun_situacao() {
		return fun_situacao;
	}

	public void setFun_situacao(String fun_situacao) {
		this.fun_situacao = fun_situacao;
	}

	

	public String getFun_email() {
		return fun_email;
	}

	public void setFun_email(String fun_email) {
		this.fun_email = fun_email;
	}

	public String getData_base() {
		return data_base;
	}

	public void setData_base(String data_base) {
		this.data_base = data_base;
	}

		

}
